// Export all services
export function getAllServices(): SearchableService[] {
  return [
    ...bankServices,
    ...telecomServices,
    ...momoServices,
    ...emergencyServices,
    ...financialServices,
    ...governmentServices,
  ];
}

export function getServicesByCategory(
  category: SearchableService["category"]
): SearchableService[] {
  return getAllServices().filter((service) => service.category === category);
}
